import "./ExpenseItem.css";

const Date = new Date("en-US");

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div>16th August 2022</div>
      <div>
        <h2 className="expense-item__description"> Car loan</h2>
        <div className="expense-item__price">5643 INR</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
